PS C:\> $Endpoint = New-UDEndpoint -Url "/process" -Method "POST" -Endpoint {
	param($Name)

	Start-Process -FilePath $Name
}
PS C:\> Start-UDRestApi -Endpoint $Endpoint
PS C:\> Invoke-RestMethod -Uri http://localhost:80/api/process -Body @{Name = "code.exe"} -Method POST

PS C:\> New-UDGrid -Title "Process Information" -Headers @("Name", "Process Id", "Start Time", "Responding") -Properties @("Name", "Id", "StartTime", "Responding")  -Endpoint {
            Get-Process -Name Chrome | Out-UDGridData
        }

PS C:\> New-UDGrid -Title "Service Information" -Headers @("Status", "Name", "Display Name") -Properties @("Status", "Name", "DisplayName")  -Endpoint {
            Get-Service | Out-UDGridData
        }

PS C:\> New-UDInput -Title "User Information" -Endpoint {
	param($FirstName, $LastName, $Address, $PhoneNumber)

	Invoke-RestMethod http://www.myserver/api/user -Method POST -Body @{
		FirstName = $FirstName
		LastName = $LastName
		Address = $Address
		PhoneNumber = $PhoneNumber
	}

	New-UDInputAction -Toast "Record saved!"
}

